import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {
  BrowserRouter as Router,
} from "react-router-dom";

ReactDOM.render(
  <React.StrictMode>
    <h1>DEDE</h1>
    <hr />
    <Router>
      <App />
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);
